import logo from './logo.svg';
import './index.css';
import Navbar from './Navbar';
import { useState } from 'react';

function App() {
  const [isDark, setIsDark] = useState(false);

  return (
    <div className={isDark ? 'bg-[#000000]' : ''}>
      <Navbar handler={() => setIsDark(true)} />
    </div>
  );
}

export default App;
